import React from 'react';
import { IonContent, IonHeader, IonPage, IonTitle, IonToolbar, IonCard, IonCardHeader, IonCardSubtitle, IonCardTitle, IonCardContent } from '@ionic/react';
import ExploreContainer from '../components/ExploreContainer';
import './Tab2.css';
import axios from 'axios';

const RequestToMyApi = () => {
  return axios({
    url: 'http://localhost:25000/perfiles',
    method: 'get'
  }).then(response => {
    return response.data;
  })
};

const Tab2: React.FC = () => {

  const [players, setPlayers] = React.useState([]);

  React.useEffect(() => {
    RequestToMyApi().then(data => setPlayers(data))
  }, []);

  const prueba = () =>{
    players.map(player => console.log(player.id_perfil));
  }
  prueba();


  return (
    <IonPage>
      <IonHeader>
        <IonToolbar>
          <IonTitle>Tab 2</IonTitle>
        </IonToolbar>
      </IonHeader>
      <IonContent fullscreen>
       {players.map(player => ( 
         <IonCard >
         <IonCardHeader>
           <IonCardSubtitle>Card Subtitle</IonCardSubtitle>
           <IonCardTitle>Card Title</IonCardTitle>
         </IonCardHeader>

          <IonCardContent>
            Keep close to Nature's heart... and break clear away, once in awhile,
            and climb a mountain or spend a week in the woods. Wash your spirit clean.
          </IonCardContent>
        </IonCard>
       ))}


      </IonContent>
    </IonPage>
  );
};

export default Tab2;
